import React from "react";
import BillProducts from "./BillProducts";

function BillDetail(props) {
  const billProducts = props.products;
  const bpList = billProducts.map((bp) => (
    <BillProducts
      key={bp.product_id}
      productId={bp.product_id}
      productQuantity={bp.product_quantity}
      productCost={bp.products_cost}
    />
  ));

  return (
    <div>
      <h1>Bill Number: {props.billNumber}</h1>
      <p>Total Cost: {props.totalCost}</p>
      <p>Credit Card: {props.creditCard}</p>
      <ul>{bpList}</ul>
    </div>
  );
}

export default BillDetail;
